import OrderProduct from '../Types/Interface/Order-Product.Interface';
import styles from './OrderModal.module.css';

interface AddButtonProps {
  closeOrderModal: () => void;
  sendOrderData: (handleAddOrder: (menuOrder: OrderProduct) => void) => void;
  handleAddOrder: (menuOrder: OrderProduct) => void;
  selectedSize: string;
  selectedTemp: string;
}

export default function AddButton({
  closeOrderModal,
  sendOrderData,
  handleAddOrder,
  selectedSize,
  selectedTemp,
}: AddButtonProps) {
  const isDisabled = selectedSize === '' || selectedTemp === '';
  const handleAddButtonClick = () => {
    closeOrderModal();
    sendOrderData(handleAddOrder);
  };

  return (
    <button className={styles.addButton} type="button" disabled={isDisabled} onClick={handleAddButtonClick}>
      담기
    </button>
  );
}
